Icarus master key generation style supports setting an extra password as an arbitrary byte array of any size. This password acts as a second factor applied to cryptographic key retrieval. When the seed comes from an encoded recovery phrase, the password can therefore be used to add extra protection in case where the recovery phrase were to be exposed. function generateMasterKey(seed, password) { let data = PBKDF2 ( kdf=HMAC-SHA512 , iter=4096 , salt=seed , password=password , outputLen=96 ); return tweakBits(data);
} function tweakBits(data) { // on the ed25519 scalar leftmost 32 bytes: // * clear the lowest 3 bits // * clear the highest bit // * clear the 3rd highest bit // * set the highest 2nd bit data[0] &= 0b1111_1000; data[31] &= 0b0001_1111; data[31] |= 0b0100_0000; return data;
} More info For a detailed analysis of the cryptographic choices and the above requirements, have a look at: Wallet Cryptography and Encoding function generateMasterKey(seed, password) { let data = PBKDF2 ( kdf=HMAC-SHA512 , iter=2048 , salt="mnemonic" + UTF8NFKD(password) , password=UTF8NFKD(spaceSeparated(toMnemonic(seed))) , outputLen=64 ); let cc = HMAC ( hash=SHA256 , key="ed25519 seed" , message=UTF8NFKD(1) + seed ); let (iL, iR) = hashRepeatedly(data); return (tweakBits(iL) + iR + cc);
} function hashRepeatedly(message) { let (iL, iR) = HMAC ( hash=SHA512 , key="ed25519 seed" , message=message ); if (iL[31] & 0b0010_0000) { return hashRepeatedly(iL + iR); } return (iL, iR);
} function tweakBits(data) { // * clear the lowest 3 bits // * clear the highest bit // * set the highest 2nd bit data[0] &= 0b1111_1000; data[31] &= 0b0111_1111; data[31] |= 0b0100_0000; return data;
}

