Our shared wallets are now fully-operational. In particular, we can access the addresses of the wallets via the GET /shared-wallets/{walletId}/addresses endpoint. We can get the address and fund it from the faucet so that we can spend from our wallet later on. After we have funded the "Cosigner#0 wallet", we can see that the balance has changed on the "Cosigner#1 wallet" as well. Both wallets have the same balance: > curl -X GET http://localhost:8090/v2/shared-wallets/2a0ebd0cceab2161765badf2e389b26e0961de2f | jq .balance { "available": { "quantity": 10000000000, "unit": "lovelace" }, "reward": { "quantity": 0, "unit": "lovelace" }, "total": { "quantity": 10000000000, "unit": "lovelace" }
} > curl -X GET http://localhost:8090/v2/shared-wallets/5e46668c320bb4568dd25551e0c33b0539668aa8 | jq .balance { "available": { "quantity": 10000000000, "unit": "lovelace" }, "reward": { "quantity": 0, "unit": "lovelace" }, "total": { "quantity": 10000000000, "unit": "lovelace" }
} Of course, this is expected. Both co-owners have full knowledge of the balance, however they cannot spend from the balance on their own. As required by the payment template, the wallet needs signatures from both co-owners before funds can be spent. Let's make a simple transaction. The owner of "Cosigner#0 wallet" will construct and sign a transaction on their end, and then provide a CBOR blob of this transaction to the owner of "Cosigner#1 wallet". Then Cosigner#1 can sign it on their own, and submit it to the network. We will be using the following shared wallet transaction endpoints: POST /shared-wallets/{walletId}/transactions-construct POST /shared-wallets/{walletId}/transactions-sign POST /shared-wallets/{walletId}/transactions-submit Note At any point during the process of constructing and signing a transaction, both "Cosigner#0" and "Cosigner#1" may decode the transaction from its CBOR representation using the POST /shared-wallets/{walletId}/transactions-decode endpoint. Decoding the transaction makes it possible to see all details associated with the transaction, such as its inputs, outputs, fees, deposits, metadata, or witness_count. Cosigner#0 Constructing "Cosigner#0" constructs a transaction sending 10₳ to an external address using the POST /shared-wallets/{walletId}/transactions-construct endpoint. In response, they receive a CBOR representation of the unsigned transaction. > curl -X POST http://localhost:8090/v2/shared-wallets/2a0ebd0cceab2161765badf2e389b26e0961de2f/transactions-construct \
-d '{ "payments":[ { "address":"addr_test1qq86pgrf7yyzp3gysxgqwt4ahegzslygvzh77eq2qwg66pedkztnw78s6gkt3eux35sllasu0x6grejewlrzaus8kekq7cp9ck", "amount":{ "quantity":10000000, "unit":"lovelace" } } ]
}' \
-H "Content-Type: application/json" | jq .transaction "" Signing "Cosigner#0" signs the transaction with the POST /shared-wallets/{walletId}/transactions-sign endpoint: > curl -X POST http://localhost:8090/v2/shared-wallets/2a0ebd0cceab2161765badf2e389b26e0961de2f/transactions-sign \
-d '{ "passphrase":"Secure Passphrase", "transaction":""
}' \
-H "Content-Type: application/json" | jq .transaction "" and in response, receives a CBOR representation of the partially-signed transaction. Cosigner#1 Now "Cosigner#0" can hand over the CBOR of the partially-signed transaction to "Cosigner#1", who can then sign it on their own. Signing "Cosigner#1" signs the transaction with POST /shared-wallets/{walletId}/transactions-sign and gets a CBOR representation of the fully-signed transaction in response. > curl -X POST http://localhost:8090/v2/shared-wallets/5e46668c320bb4568dd25551e0c33b0539668aa8/transactions-sign \
-d '{ "passphrase":"Secure Passphrase", "transaction":""
}' \
-H "Content-Type: application/json" | jq .transaction "" Submission The transaction is now fully-signed by both co-owners: "Cosigner#0" and "Cosigner#1". At this point, either of them can submit it to the network using their respective wallets via the POST /shared-wallets/{walletId}/transactions-submit endpoint. > curl -X POST http://localhost:8090/v2/shared-wallets/5e46668c320bb4568dd25551e0c33b0539668aa8/transactions-submit \
-d '{ "transaction":""
}' \
-H "Content-Type: application/json" | jq { "id": "d443719bbd3e4301aa34791823b2b7821757e843509d29918006e5ca26ca368c"
} The transaction has been submitted successfully. The POST /shared-wallets/{walletId}/transactions-submit endpoint provides a transaction identifier in its response. We can use this transaction identifier to look up the transaction from either shared wallet using the GET /shared-wallets/{walletId}/transactions or GET /shared-wallets/{walletId}/transactions/{transactionId} endpoints. "Cosigner#0 wallet": > curl -X GET http://localhost:8090/v2/shared-wallets/2a0ebd0cceab2161765badf2e389b26e0961de2f/transactions/d443719bbd3e4301aa34791823b2b7821757e843509d29918006e5ca26ca368c | jq { "amount": { "quantity": 10176721, "unit": "lovelace" }, ... "direction": "outgoing", ... "fee": { "quantity": 176721, "unit": "lovelace" },
... "Cosigner#1 wallet": > curl -X GET http://localhost:8090/v2/shared-wallets/5e46668c320bb4568dd25551e0c33b0539668aa8/transactions/d443719bbd3e4301aa34791823b2b7821757e843509d29918006e5ca26ca368c | jq { "amount": { "quantity": 10176721, "unit": "lovelace" }, ... "direction": "outgoing", ... "fee": { "quantity": 176721, "unit": "lovelace" },
...
